import React, { Component } from 'react';

import './App.css';
import './styles/ThreeImages.css'
// import WhyOla from './WhyOla'

class BookNow extends Component {


    render() {

        return (
            <div style={{ height: "auto", backgroundColor: "white", marginTop: "80px", width: "100%", display: "inlineBlock" }}>
                <div style={{backgroundColor:"red",width:"40%",height:"100%"}}></div>
                <div style={{backgroundColor:"blue",width:"60%",height:"100%"}}></div>
            </div>
        );
    }
}

export default BookNow;
